import React from "react";

export default function Footer() {
  return (
    <>
      <div className="fluid-container" style={{backgroundColor:"#D27685", color:"#fff"}}>
        <div className="fluid-container bg-warning text-dark mt-4 pt-4 pb-2">
          <h6 className="text-muted text-center mt-2">
            CollegeFun | copyrights@collegefun2022
          </h6>
        </div>
      </div>
    </>
  );
}
